column6:
친절한 배닭과 변함없는 맛 ""
넘 맛있게 먹었네요^^
한가지 아쉬운점은 감자가 너무 적었어요;;

1시간10분걸려 왔는데
 튀김은 차갑고 치킨은 다식어서 왔네요;
자주시켜먹는데  오늘은 ㅜㅜ

이벤트때문에 저렴하게 먹었네요
배달기사님 요청사항 확인 좀 해주세요
벨에 전화에;;

양이 엄청 많어서 받자마자 놀랐네요 ㅎ
근데 후라이드만 계속 먹으니 좀 물리는 느낌도;
그래도 맛있게 잘 먹었습니다~ ^^

배달한지 거의 두시간이 다되어서 받았네요;;
치킨 자주 시켜먹는데 이런적은 처음..
근데 서비스하나 없고;;;

날이 좀 쌀쌀해 지긴 했지만 .....
다 식어서 차가운 치킨이 왔어요 ;;;
맛있는건 변함 없지만 식은 정도가 좀 심해서 ;;
다음에는 따뜻하게 먹게 하 주세요 ㅠ

ㄹㅇ 맛있어서 학교 끝나고 집 와서 또 시킬 생각이었음
그래서 요기요 켰는데 리뷰 안 써서 지금 쓰는 중;;
아무튼 맛있습니다

ㄹㅇ 역시 허니콤보
레드도 좋아하지만 너무 적은 크기와 양으로;;
교촌은 허니콤보로만 시킴 배달비만 없으면 1.8 값어치 함
